import React, { Suspense } from 'react';
import './App.css';
import CircularProgress from '@material-ui/core/CircularProgress';
import { Route, Switch } from "react-router-dom";
function App() {
  return (
    <Suspense fallback={(<CircularProgress />)}>
      <Switch>
        <Route />
      </Switch>
    </Suspense>
  );
}

export default App;
